import './App.css';
import Header from './components/Header';
import {BrowserRouter as Router, Switch, Route, Link, Redirect} from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <Header />
      <nav>
        <Link to="">A</Link>
        <Link to="">B</Link>
        <Link to="">C</Link>
        <Link to="">D</Link>
        <Link to="">E</Link>
      </nav>
      <div className="main-app">
        <Router>
          <Switch>
            <Route></Route>

          </Switch>
        </Router>
      </div>
    </div>
  );
}

export default App;
